import React,{Component} from 'react';
import './App.css';

class App extends Component {
  state = {
    contacts: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      console.log(data);
    })
    .catch(console.log)
  }
  render() {
    return (
        ''
    );
  }
}

export default App;
